import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Headroom from 'react-headroom';

class NavBar extends Component {
  render() {
    return (
      <Headroom>
      <nav class="navbar navColor">
        <Link to="/homepage" > <img class="logo" src="logo.png"></img></Link>
        <ul id="nav-mobile" class="right hide-on-med-and-down">
          <li><Link to="/homepage" >Home <i class="material-icons right">home</i></Link></li>
          <li><Link to="/lesson_1" >Play <i class="material-icons right">toys</i></Link></li>
        </ul>
      </nav>
      </Headroom>
    )
  }
}
export default NavBar;
